  \"2014-04-24T15:02:52.391794\",\n\t\"name\": \"an-evaluation-of-stormwater-management-in-a-watershed-of-the-minnesota-valley-national-wil\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Minnesota Valley National Wildlife
  Refuge provides valuable habitat for waterfowl, fish, and other wildlife species
  threatened by commercial and industrial development. Possible contaminants contained
  in the storm water discharged into the Refuge are a potential pollution problem.
  An instrumentation system was designed to study contaminants in stormwater from
  different land use activities in the City of Bloomington. The study was largely
  focused on gathering samples from rainfall events. Nonetheless, snowmelt samples
  were gathered in 2005 and 2006. Grab samples were also taken from a seep location
  in 2004, 2005 and 2006. Pollutant loads and the ability of Pond C to filter pollutants
  were both analyzed.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
